import React from "react";
import { useDispatch } from "react-redux";
import { setFeatureToModify } from "../store/updateSlice";
import { setShowUpdateModal } from "../store/updateSlice";


const StopEditingButton = () => {
  const dispatch = useDispatch();

  const handleClick = () => {
    dispatch(setFeatureToModify(null));
    dispatch(setShowUpdateModal(true));
  };

  return (
    <button
      onClick={handleClick}
      className="fixed bottom-4 right-4 bg-red-600 text-white px-4 py-2 rounded shadow-lg hover:bg-red-500 focus:outline-none focus:ring-2 focus:ring-red-400 focus:ring-opacity-50 text-sm"
    >
      Stop Editing
    </button>
  );
};

export default StopEditingButton;
